            key: 'weight',
            type: 'number',
            render: function(row) {
                return (
                    <span>
                        {row[this.key]}
                    </span>
                );
            }
        },
        {
            name: 'Diet',
            key: 'diet',
            type: 'text',
            render: function(row) {
                return (
                    <span>
                        {row[this.key]}
